import React, { useState } from 'react'
import './App.css'
import { IState } from './types'

function App() {
  const [state, setState] = useState<IState[]>([
    {
      name: 'Artem',
      _id: '1',
      roots: [],
      branches: [{}],
    },
    {
      name: 'Ivan',
      _id: '2',
      roots: [],
      branches: [{}],
    },
  ])

  return (
    <div>
      {state.map((item, index) => (
        <div key={index}>{item.name}</div>
      ))}
    </div>
  )
}

export default App
